  Streamlit,
  withStreamlitConnection,
  StreamlitComponentBase
} from "streamlit-component-lib"
import React, { ReactNode} from "react"
import IconButton from '@material-ui/core/IconButton';
import ArrowForwardIosIcon from '@material-ui/icons/ArrowForwardIos';
import { styled, TextField, Dialog, DialogTitle} from "@material-ui/core"


class ImageZoom extends StreamlitComponentBase {
  public render = (): ReactNode => {
    return (
      <div style={{
        width: "100px",
        height: "100px",
        backgroundColor: "red",
        position: "absolute",
        top: "0px",
        left: "0px",
        transform: "translateX(50%) translateX(-50px) translateY(50%) translateY(-50px) "
      }}></div>
    )
  }
}

export default withStreamlitConnection(ImageZoom)
